import React, { useEffect } from "react";
import { connect } from "react-redux";
import * as actions from "../Actions/usuarios";
import { Grid,Paper,TableContainer,table, TableHead,TableRow,TableCell } from "@material-ui/core";


const Usuarios = (props) => {
    // const [x,setX] = useState(0)

    useEffect(() => {
        props.fetchallUsuarios()
    },[])



    return (
        <Paper>
            <Grid container>
                <Grid item xs={6}>
                    <usuarioform />
                </Grid>

                <Grid item xs={6}>
                    <TableContainer>
                        <table>
                            <TableHead>
                                <TableRow>
                                    <TableCell>Usuario</TableCell>
                                    <TableCell>Senha</TableCell>
                                </TableRow>
                            </TableHead>
                        </table>
                    </TableContainer>
                </Grid> 

            </Grid>
        </Paper>
    );
}

const mapStateToProps = state => ({
        usuarioList: state.usuarioList
    })

const mapActionToProps = {
    fetchallUsuarios : actions.fetchall
}

export default connect(mapStateToProps,mapActionToProps)(Usuarios);
